import React, {Component} from "react";
import "./Skills.css";

class Skills extends Component{
	render() {
		return (
			<div id = "Skills">
				<h1 className = "title"><my className = "my">MY</my> EXPERIENCES</h1>
				<div className = "exp">
					<h1 className = "lang">LANGUAGES</h1>
					<h1 className = "tech">TECHNOLOGIES</h1>
					<h1 className = "skills">SKILLS</h1>
				</div>
			</div>

		);
	}
}

export default Skills;
